function ListTrending() {
  return (
    <div className="listrending">
      <h2>Trending</h2>
      <p>- - - - - - - - - - - - - - - - - - - -  </p>
      <div class="listrending">
        <div class="card">
          <div class="inside">
            <div class="circle">1</div>
          </div>
          <div class="text">
            <p class="header">That's The Header</p>
            <p class="content">Lorem ipsum dolor sit amet.</p>
          </div>
        </div>
      </div>

    </div>
  );
}

export default ListTrending;
